                                    <tr>
                                      <th>{MYCONSTANT.NAME}</th>
                                      <th>{MYCONSTANT.DESCRIPTION}</th>
                                    </tr>
                                  </thead>
                                  <tbody>
                                    {/* {data[i]?.post.parameters.map((n) => ( */}
                                    <tr>
                                      <td>
                                        <p>
                                          <small className="text-red-900">
                                            {data[j]?.post?.parameters[j]?.name
                                              ? data[j]?.post?.parameters[j]
