                                              ? data[j]?.get?.parameters[j]
                                                  ?.name
                                              : data[j]?.put?.parameters[j]
                                                  ?.name
                                              ? data[j]?.put?.parameters[j]
                                                  ?.name
                                              : data[j]?.delete?.parameters[j]
                                                  ?.name}
                                            <sup>
                                              {data[j]?.post?.parameters[j]
                                                ?.name
                                                ? data[j]?.post?.parameters[j]
                                                    ?.name
                                                : data[j]?.get?.parameters[j]
                                                    ?.name
                                                ? data[j]?.get?.parameters[j]
                                                    ?.name
                                                : data[j]?.put?.parameters[j]
                                                    ?.name
                                                ? data[j]?.put?.parameters[j]
                                                    ?.name
                                                : data[j]?.delete?.parameters[j]
